import React, {useState} from 'react';
import { Route, Switch, Link } from 'react-router-dom';
import { Home, Posts } from "./components";
import { fetchPosts } from './api/api';

const App = () => {
    const {post, setPosts} = useState([]);
  return (
    <div>
        <nav>
            <Link to="/">Home</Link>
            <Link to="/posts">Posts</Link>
        </nav>
        <Switch>
            <Route exact path="/">
                <Home />
            </Route>
            <Route path="/posts">
                <Posts />
            </Route>
        </Switch>
    </div>
  )
}

export default App;
